script: |
  super -f tsv -I q8905.sql | sort > q8905.out

vector: true

inputs:
  - name: q8905.sql
    data: |
      SELECT + + col1 AS col0 FROM tab0 AS cor0 GROUP BY col1 HAVING + COALESCE ( - + col1, + AVG ( ALL - col1 ), - 96 ) IS NOT NULL;
  - name: tab0

outputs:
  - name: q8905.out
    data: |
      0
      81
